query users($orderBy: UserOrderByInput, $skip: Float, $take: Float, $where: UserWhereInput) {
  items: users(orderBy: $orderBy, skip: $skip, take: $take, where: $where) {
    createdAt
    firstName
    id
    lastName
    roles
    updatedAt
    username
    __typename
  }
  total: _usersMeta(where: $where) {
    count
    __typename
  }
}
